import React from "react";

function Home() {
  return (
    <div className="home">
      <h2>환영합니다!</h2>
      <p>이 웹 서비스는 실시간 프로그래밍 언어 트렌드와 예측 정보를 제공합니다.</p>
    </div>
  );
}

export default Home;
